import React from "react";
import Products from "../product";
import { Container, Row, Col } from "react-bootstrap";
const Home = () => {
  return (
    <>
      <Row>
        <Col>{Products.map((i) => i)}</Col>
      </Row>
    </>
  );
};
export default Home;
